-- ----------------------------
-- Table structure for t_agriculture_equipment
-- ----------------------------
DROP TABLE IF EXISTS `t_agriculture_equipment`;
CREATE TABLE `t_agriculture_equipment`  (
  `id` bigint(20) NOT NULL COMMENT '主键',
  `name` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '设备名称',
  `number` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '设备编号',
  `manufacturer` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '设备厂商',
  `release_date` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '出厂日期',
  `network_way` int(10) NULL DEFAULT NULL COMMENT '联网方式(1wifi, 2 4G,3 5G,4 有线传输，5 NB-LOT,6 以太网)',
  `access_way` int(10) NULL DEFAULT NULL COMMENT '设备接入方式(1 HTTP,2 EDP,3 MOTT,4 Modbus,5 JT/T808,6 TCP透传)',
  `gateway_id` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '网关ID',
  `status` int(2) NULL DEFAULT NULL COMMENT '设备状态(1 在线 2故障 3 离线 4报警)',
  `status_reason` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '异常原因',
  `is_on_the_scene` int(2) NULL DEFAULT NULL COMMENT '设备是否在场(0 否 1是)',
  `type` int(10) NULL DEFAULT NULL COMMENT '设备类型(关联字典表)',
  `site_id` bigint(20) NULL DEFAULT NULL COMMENT '设备安装Id(关联设备安装表)',
  `install_coordinate` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '设备安装坐标',
  `install_address` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '设备安装地址',
  `collection_frequency` float(10, 0) NULL DEFAULT NULL COMMENT '设备采集频率',
  `collection_frequency_unit` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '月 month 天 day 小时 hour 分钟minute ',
  `illustrate` varchar(500) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '说明',
  `project_id` bigint(20) NULL DEFAULT NULL COMMENT '项目Id(关联项目表)',
  `create_time` datetime(0) NULL DEFAULT NULL COMMENT '创建时间',
  `create_by` bigint(20) NULL DEFAULT NULL COMMENT '创建人',
  `update_time` datetime(0) NULL DEFAULT NULL COMMENT '修改时间',
  `update_by` bigint(20) NULL DEFAULT NULL COMMENT '修改人',
  `is_delete` int(11) NULL DEFAULT NULL COMMENT '是否删除 0 否 1是',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '设备基础信息表' ROW_FORMAT = Dynamic;

